import { doPostAsync } from "../http/http";
import { ip, tomcatPort } from "../../misc/constants";
import authHeader from "../user/auth-header";

/**
 * @author Sven
 * Service that communicates with the backend to start a charger
 * @version 09/08/2021
 *
 */

/**
 * Starts a charger
 * @returns {Promise<void>}
 */
const startCharger = (scheduledEndTime) => {
 return doPostAsync(`http://${ip}:${tomcatPort}/api/charger/startChargerSession`,
     {scheduledEndTime: scheduledEndTime.getTime()}, authHeader());
}

export {startCharger};
